 .picBox ,   .style-facts {
   z-index: 20;
}
.style-nums{
    z-index: 25;
}

.shark , .sharks ,  .dog , .scuba .terra {
    z-index: 3;
}

.shark:hover , .sharks:hover , .dog:hover , .scuba:hover , .terra:hover {
 z-index: 9999; 
 transition: z-index .4s;
 transition-timing-function: ease-out;
}

.wish-upon , .covid-trace , .disney-find {
    z-index: 9; 
}
.wish-upon:hover , .covid-trace:hover , .disney-find:hover {
    z-index: -1; 
    transition: z-index .4s;
    transition-timing-function: ease-out;
}
